#!/usr/bin/env python3
global dig
def dig(code):
    thing = ''
    if len(code) == 0:
        print('Great job!')
        return
    
    if code[0] == 'S':
        thing = __import__("zlib").decompress(__import__("base64").b64decode(thing))
        thing = bytes(x^0xf8 for x in thing)
        thing = thing.decode()
        exec(thing)
        dig(code[1:])

    else:
        print('Nope!')
code = input("Which way do you want to go? ")
assert len(code) == 29
dig(code)
